public void initValue()
{
    super();

    this.AutoPostOnImportOptionPayEqualsInvoice = NoYes::Yes;
    this.CCPayLinkEnumUpgraded = NoYes::Yes;
    this.BRManualEntry = NoYes::Yes;
    this.BRDefaultFromImportJournal = NoYes::Yes;
}

public void update()
{
    ttsbegin;
    SKS_PP_Bank::UpdateFromSetup(this);
    SKS_LB_Depositor::UpdateWriteoffIdFromSetup(this);
    super();
    ttsCommit;

    SKS_SCF_Provider::updateSCFProvider(this.SCFAutoPmtInvJrnl,this.SCFAutoPmtInvPost,this.SCFCreateNoMismatch,this.SCFInvoiceJournalName,
                                        this.SCFPaymentJournalName,this.SCFOffsetLedgerDimension, this.SCFPaymentPostingDate, this.SCFInvoicePostingDate);


}

public void write()
{
    SKS_LB_Depositor    SKS_LB_Depositor;

    super();

    while select AutoCRFromSetup, WriteoffID from SKS_LB_Depositor where SKS_LB_Depositor.AutoCRFromSetup == NoYes::Yes
    {
        SKS_LB_Depositor.WriteOffId = this.LBWriteOffId;
    }



}

/// <summary>
/// Finds TAS setup record.
/// </summary>
/// <param name = "_forUpdate">Flag for update</param>
/// <returns>TAS setup record</returns>
public static SKS_PP_Setup find(boolean  _forUpdate = false)
{
    SKS_PP_Setup sks_pp_setup;

    if (_forUpdate)
    {
        sks_pp_setup.selectForUpdate(_forUpdate);
    }

    select firstonly sks_pp_setup;

    return sks_pp_setup;
}

