/// <summary>
/// Determines whether the current record is valid and ready to be written to the database.
/// SKS_BR5 8663 CR
/// </summary>
/// <returns>Returns true if record is valid</returns>
public boolean validateWrite()
{
    boolean ret;
    SKS_LB_MatchingRules    matchingRules; // CR-9479

    ret = super();

    if(this.BRNotifyStatements == NoYes::Yes)
    {
        if(this.BREmail == '' || this.BRBatchJobId == 0)
        {
            ret = ret && checkFailed("@SKS:NewLabel40");
        }
    }

    // CR-9479 -->
    if(this.BRInvoiceNotFound != SKS_BR_InvoiceNotFound::None && this.BRCustRemitAnalysisRuleGroup == '')
    {
        ret = ret && checkFailed("@SKS:SKGCustRemitRuleGrpMust");
    }
    select firstonly RecId from matchingRules
        where matchingRules.GroupID      == this.MatchingRulesGroupIdCustSettle
            && (matchingRules.lookupType == SKS_LB_MatchType::CustomerAndAmount
            || matchingRules.lookupType  == SKS_LB_MatchType::CustomerAndInvBalance);

    if (matchingRules.RecId && this.BRCustRemitAnalysisRuleGroup == '' && this.BRInvoiceNotFound == SKS_BR_InvoiceNotFound::None)
    {
        ret = ret && checkfailed("@SKS:SKGCustRemitRuleGrpMust");
    }
    // CR-9479 <--
    return ret;
}

/// <summary>
///     Used to validate field values
/// </summary>
/// <param name = "_fieldIdToCheck">Field Id to check</param>
/// <returns>Returns true if the record field is valid</returns>
public boolean validateField(FieldId _fieldIdToCheck)
{
    boolean ret;
    CustPaymModeTable paymMode;

    ret = super(_fieldIdToCheck);

    if (ret)
    {
        switch (_fieldIdToCheck)
        {
            case fieldNum(SKS_PP_Setup, CCOneClickPaymReversalPaymMode):
                if (this.CCOneClickPaymReversalPaymMode)
                {
                    paymMode = CustPaymModeTable::find(this.CCOneClickPaymReversalPaymMode);
                    if (paymMode.RecId)
                    {
                        if (PaymMode.PaymentType != CustPaymentType::CreditCard)
                        {
                            ret = checkFailed(strFmt("@SKS6475", enum2str(CustPaymentType::CreditCard)));
                        }
                        else
                        {
                            if (paymMode.PaymStatus != CustVendPaymStatus::Confirmed)
                            {
                                ret = checkFailed(strFmt("@SKS6476", enum2str(CustVendPaymStatus::Confirmed)));
                            }
                        }
                    }
                }
                break;
            case fieldNum(SKS_PP_Setup, CCPLPrePaymentPaymMode):
                if (this.CCPLPrePaymentPaymMode)
                {
                    paymMode = CustPaymModeTable::find(this.CCPLPrePaymentPaymMode);
                    if (paymMode.RecId)
                    {
                        if (PaymMode.PaymentType != CustPaymentType::CreditCard)
                        {
                            ret = checkFailed(strFmt("@SKS6475", enum2str(CustPaymentType::CreditCard)));
                        }
                        else
                        {
                            if (paymMode.PaymStatus != CustVendPaymStatus::Confirmed)
                            {
                                ret = checkFailed(strFmt("@SKS6476", enum2str(CustVendPaymStatus::Confirmed)));
                            }
                        }
                    }
                }
                break;
            case fieldNum(SKS_PP_Setup, CCProjSvcOrderPaymMode):
                if (this.CCProjSvcOrderPaymMode)
                {
                    paymMode = CustPaymModeTable::find(this.CCProjSvcOrderPaymMode);
                    if (paymMode.RecId)
                    {
                        if (PaymMode.PaymentType != CustPaymentType::CreditCard)
                        {
                            ret = checkFailed(strFmt("@SKS6475", enum2str(CustPaymentType::CreditCard)));
                        }
                        else
                        {
                            if (paymMode.PaymStatus != CustVendPaymStatus::None)
                            {
                                ret = checkFailed(strFmt("@SKS6476", enum2str(CustVendPaymStatus::None)));
                            }
                        }
                    }
                }
                break;
            case fieldNum(SKS_PP_Setup, BRPath):
                ret = SKS_BR_File::PathForwardSlashExists(this.BRPath) ? checkFailed("@sks:SKGFileForwardSlashValidate") : ret ;
                break;
        }
    }

    return ret;
}

/// <summary>
/// Determines is credit card invoice proposal enabled.
/// </summary>
/// <returns>If enabled returns true</returns>
public static boolean isCreditCardInvoiceProposalEnabled()
{
    SKS_PP_Setup    sks_pp_setup;
    boolean         ret;

    sks_pp_setup = SKS_PP_Setup::find();

    if (sks_pp_setup && sks_pp_setup.ModCC == NoYes::Yes &&
        (sks_pp_setup.CCAllowCCProcFromSvcOrder == NoYes::Yes || sks_pp_setup.CCAllowCCProcFromProjInvProposal == NoYes::Yes))
    {
        ret = true;
    }

    return ret;
}

